import { IonButton, IonButtons,  IonCol, IonContent, IonGrid, IonHeader, IonMenuButton, IonPage,  IonTitle, IonToolbar, IonCard, IonCardContent, IonCardHeader, IonCardSubtitle, IonCardTitle } from '@ionic/react';
import { add, close, pencil } from 'ionicons/icons';
import { useEffect, useState } from 'react';
import { useHistory, useParams } from 'react-router';



const CV: React.FC = (props: any) => {
  const { name } = useParams<{ name: string; }>();





  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonButtons slot="start">
            <IonMenuButton />
          </IonButtons>
          <IonTitle>{name}</IonTitle>
        </IonToolbar>
      </IonHeader>

      <IonContent fullscreen>
        <IonHeader collapse="condense">
          <IonToolbar>
            <IonTitle size="large">{name}</IonTitle>
          </IonToolbar>
        </IonHeader>


        <IonContent>
          <IonCard>
            <IonTitle>Adelina Mayol</IonTitle>

            <IonCardHeader>
              <IonCardTitle>Card Title</IonCardTitle>
              <IonCardSubtitle>Card Subtitle</IonCardSubtitle>
            </IonCardHeader>

            <IonCardContent>Here's a small text description for the card content. Nothing more, nothing less.</IonCardContent>


          </IonCard>


        </IonContent>






      </IonContent>
    </IonPage>
  );
};

export default CV;
